import React from 'react';
import useDatafetch from '../useDatafetch';

function CasesContainer (){
    const [data , setData] =useDatafetch();
    return(
        <div className="bg-warning flex-fill">
            <h1>Cases</h1>
            <h3>{data.cases}</h3>
        </div>
    );
};
export default CasesContainer;
